import * as React from 'react';
import Box from '@mui/material/Box';
import { Button, Typography } from '@mui/material';
export default function BoxSystemProps({ job }) {
  return (
    <Box
      bgcolor="#424242"
      height={250}
      width={300}
      my={5}
      display="flex"
      alignItems="center"
      flexDirection="column"
      gap={2}
      p={2}
      marginLeft={5}
      borderRadius={3}
     
    >
    <Typography
      textAlign="center"
      color="#fff"
    >
      {job.title}
    </Typography>
    <Typography
      color="#fff"
    >
      {job.description}
    </Typography>
    <Button
      variant="contained"
      style={{
        justifyContent: 'center',
        alignContent: 'center'
      }}
>
  LEARN MORE
</Button>

    </Box>
  );
}
